import React from 'react';
import '../styles/Footer.css'

const footerStyle = {
    mainDiv: {
      justifyContent: 'space-around',
      textAlign: 'top',

  },
    anchors: {
      color: '#8e979b',
      textAlign: 'center',
      padding: 0,
      margin: 10,
      alignItems: 'top',
  }
}

function Footer() {
    return (
  <footer class="center">
  <div class="container mainDiv">  

    <div class="mainDiv"> 
      <div style={footerStyle.mainDiv}>
        <ul class="row-expand-sm  flex-row align-items-top">

        <li class="b-nav-item col-2">
        <a style={footerStyle.anchors} className="link col-2" href="https://github.com/MaryiaVinogradova" target="_blank col-2"><i
                className="bi bi-github" id="icon"></i></a>
        </li>  

        <li class="b-nav-item col-2">
        <a style={footerStyle.anchors} className="link col-4" href="https://www.linkedin.com/in/maryiavinogradova/"
                target="_blank col-2"><i className="bi bi-linkedin" id="icon"></i></a>
        </li>

        </ul>
        </div>
    </div> 
  </div>    
  </footer>
    );
  }

export default Footer;
